  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {};
export const metadata = {
  "unversionedId": "markdown",
  "id": "markdown",
  "isDocsHomePage": false,
  "title": "markdown",
  "description": "Git Hub Samples",
  "source": "@site/docs/markdown.md",
  "permalink": "/markdown",
  "editUrl": "https://github.com/saucelabs/sauce-docs/edit/master/docs/markdown.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
  /* @jsx mdx */

export const rightToc = [{
  value: 'H2',
  id: 'h2',
  children: [{
    value: 'H3',
    id: 'h3',
    children: []
  }]
}];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Git Hub Samples`}</p>
    <p><button class="badge-ent">ENTERPRISE ONLY</button></p>
    <button class="badge-dep">DEPRECATED</button>
    <h1 {...{
      "id": "h1"
    }}>{`H1`}</h1>
    <h2 {...{
      "id": "h2"
    }}>{`H2`}</h2>
    <h3 {...{
      "id": "h3"
    }}>{`H3`}</h3>
    <p><em parentName="p">{`Italic`}</em></p>
    <p><strong parentName="p">{`Bold`}</strong></p>
    <p><strong parentName="p"><em parentName="strong">{`Bold AND Italic!`}</em></strong></p>
    <ul>
      <li parentName="ul">{`Bullet Item 1`}</li>
      <li parentName="ul">{`Bullet Item 2`}</li>
      <li parentName="ul">{`Bullet Item 3`}<ul parentName="li">
          <li parentName="ul">{`Sub-Bullet 1`}</li>
          <li parentName="ul">{`Sub-Bullet 2`}</li>
        </ul></li>
    </ul>
    <ol>
      <li parentName="ol">{`Numbered 1`}</li>
      <li parentName="ol">{`Numbered 2`}<ol parentName="li">
          <li parentName="ol">{`Sub-Ordered`}</li>
          <li parentName="ol">{`Sub-Ordered`}</li>
        </ol></li>
      <li parentName="ol">{`Numbered 3`}</li>
    </ol>
    <p>{`Open the `}<inlineCode parentName="p">{`.bash_profile`}</inlineCode>{` page.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-js"
      }}>{`parse_git_branch() {
     git branch 2> /dev/null | sed -e '/^[^*]/d' -e 's/* \\(.*\\)/ (\\1)/'
}
export PS1="\\u@\\h \\[\\033[36m\\]\\w\\[\\033[32m\\]\\$(parse_git_branch)\\[\\033[00m\\] $ "
`}</code></pre>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`NOTE:`}</strong>{` This is a fun fact.`}</p>
      <p parentName="blockquote">{`This is a new paragraph in the same fun fact.`}</p>
    </blockquote>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Column 1`}</th>
          <th parentName="tr" {...{
            "align": "center"
          }}>{`Column 2`}</th>
          <th parentName="tr" {...{
            "align": "right"
          }}>{`Column 3`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Left Aligned`}</td>
          <td parentName="tr" {...{
            "align": "center"
          }}>{`Centered`}</td>
          <td parentName="tr" {...{
            "align": "right"
          }}>{`Right Aligned`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Wider`}</td>
          <td parentName="tr" {...{
            "align": "center"
          }}>{`Normal`}</td>
          <td parentName="tr" {...{
            "align": "right"
          }}>{`Normal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Pipes don't have to line up`}</td>
          <td parentName="tr" {...{
            "align": "center"
          }}><em parentName="td">{`You`}</em>{` `}<strong parentName="td">{`can`}</strong>{` `}<strong parentName="td"><em parentName="strong">{`format`}</em></strong></td>
          <td parentName="tr" {...{
            "align": "right"
          }}>{`Or include `}<inlineCode parentName="td">{`code`}</inlineCode></td>
        </tr>
      </tbody>
    </table>
    <table>
  <tr>
    <td><font size="5">Hub Title 1</font></td>
    <td><font size="5">Hub Title 2</font></td>
  </tr>
  <tr>
    <td>This section will have a bullet list in the cell.<br />
      <ul>
        <li><a href="/ci/jenkins">link1</a></li>
        <li><a href="/ci/azure">link2</a></li>
        <li><a href="/ci/bamboo">link3</a></li>
      </ul>
    </td>
    <td>This section will have a numbered list in the cell.<br />
      <ol>
        <li><a href="https://circleci.com/integrations/saucelabs/">External Link1</a></li>
        <li><a href="https://docs.travis-ci.com/user/sauce-connect/">External Link2</a></li>
      </ol>
    </td>
  </tr>
  <tr>
    <td align="center" colspan="2"><font size="5">Centered Row Spans 2 Columns</font></td>
  </tr>
  <tr>
    <td colspan="2">This row also spans both columns</td>
  </tr>
    </table>
    <p><a parentName="p" {...{
        "href": "https://sauce-docs.com"
      }}>{`Displayed Link Text`}</a></p>
    <p><img alt={"Image Tooltip"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./assets/ninjabot.png").default} /></p>
    <img src="/docs/assets/ninjabot.png" width="100" />
    <img src="/static/img/saucy.gif" alt="Sneaky Sauce" width="100" />  
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
